export abstract class CharCodes {
  /**
   * Right angle bracket ">".
   */
  public static rightAngleBracket = new Uint8Array([0x3e]);
  /**
   * Left angle bracket "<".
   */
  public static leftAngleBracket = new Uint8Array([0x3c]);
  /**
   * Right parenthesis ")".
   */
  public static rightParenthesis = new Uint8Array([0x29]);
  /**
   * Left parenthesis "(".
   */
  public static leftParenthesis = new Uint8Array([0x28]);
  /**
   * Right square bracket "]".
   */
  public static rightSquareBracket = new Uint8Array([0x5d]);
  /**
   * Left square bracket "[".
   */
  public static leftSquareBracket = new Uint8Array([0x5b]);
  /**
   * Forward slash "/".
   */
  public static forwardSlash = new Uint8Array([0x2f]);
  /**
   * Forward slash "\".
   */
  public static slash = new Uint8Array([0x5c]);
  /**
   * Space " ".
   */
  public static space = new Uint8Array([0x20]);
  /**
   * Flag "n".
   */
  public static n = new Uint8Array([0x6e]);
  /**
   * Flag "f".
   */
  public static f = new Uint8Array([0x66]);
  /**
   * Char "R".
   */
  public static r = new Uint8Array([0x52]);
  /**
   * Char "0".
   */
  public static zero = new Uint8Array([0x30]);
  /**
   * Char "\n".
   */
  public static endLine = new Uint8Array([0x0a]);
  /**
   * Char "\r".
   */
  public static carriageReturn = new Uint8Array([0x0d]);
  /**
   * Char "%".
   */
  public static percent = new Uint8Array([0x25]);
}
